gqz(){return"Privacy Policy \u2013 ASConnect Application\n\n1) Data Controller Identity\nData collected in the ASConnect application are processed by AngelmanAnalytics, acting as data controller.\nFor any questions regarding your data or the exercise of your rights, you can contact us at: contact@angelmananalytics.org.\n\n____________________________________________\n2) Purposes of Processing\nData processing carried out through the application serves the following purposes:\n\u2022 Creation and management of your user account for named access to the ASConnect application;\n\u2022 Use of geolocation features to visualize:\n  o Profiles of people concerned, according to various criteria (geographical distance, genotype, age group);\n  o Improvement of the service and personalization of the user experience.\n\u2022 Extraction of non-identifying data for statistical purposes: number of people affected by Angelman syndrome, age distribution, etc.\n\n____________________________________________\n3) Categories of Data Collected\nThe following data may be collected:\n\u2022 Identification data:\n  o last name, first name, email address, password, photo,\n  o security question and answer (in case of forgotten password);\n\u2022 Sensitive data:\n  o genotype, location.\nThe legal basis for these processing activities is the explicit and informed consent of the user.\n\n____________________________________________\n4) Data Retention Period\nData are kept for the entire duration of account use and then deleted within a maximum of 12 months after the last activity.\nUsers may exercise their right to erasure at any time directly in the application via:\nPrivacy Policy \u2192 Right to be Forgotten.\n\n____________________________________________\n5) Data Recipients and Hosting\nData are securely hosted on PythonAnywhere servers.\nData are stored within the European Union.\n(For more information on the host\u2019s data protection policy, see https://www.pythonanywhere.com/privacy/.)\n\n____________________________________________\n6) User Rights\nIn accordance with Regulation (EU) 2016/679 (GDPR), users have the following rights:\n\u2022 Right of access, rectification, and erasure (\u201cright to be forgotten\u201d) \u2014 directly via their profile or the Privacy Policy \u2192 Right to be Forgotten menu;\n\u2022 Right to object, data portability, and restriction of processing;\n\u2022 Right to withdraw consent at any time.\nTo exercise these rights (other than the right to erasure available in the application), you may contact: contact@angelmananalytics.org.\n\n____________________________________________\n7) Security and Confidentiality\nAll data are encrypted during storage and transmission.\nPasswords are hashed according to best security practices, and all communications with the service use the HTTPS protocol.\n\n____________________________________________\n8) Explicit Consent\nRegistration for the ASConnect application requires the user\u2019s explicit and informed consent for the processing described in section 2.\nUsers may withdraw their consent at any time via their account settings or by contacting contact@angelmananalytics.org."},
